<p>这个总耗时就有些长了很影响系统体验，此时就可以使用@Async进行一个异步调用，此时主线程就不需要等待task1执行完之后，再去调用task2、task3，主线程会同时去调用task1、task2、task3任务，3个任务会同时执行，那么此时该接口的总耗时就是耗时最长的task3任务的3秒；</p>
